import React from 'react';
import Home from './routes/home/Home';
import { Route, Switch, Redirect } from 'react-router-dom'
export default class App extends React.Component {

    render() {
        return (
            <Switch>
                <Route exact path="/" compontent={Home} />

            </Switch>
        )
    }
}
